webpackJsonp([0xe3ed9c6b1111],{7381:function(t,e){t.exports={data:{post:{html:'<p>We\'ll be flying to Minnesota next week and spending two weeks on Lake Minnewaska at my parents\' lake house near <a href="http://www.starbuckmn.org/" title="Starbuck Minnesota USA - City and Chamber of Commerce">Starbuck</a> (not to be confused with the <a href="http://www.starbucks.com/">coffee shop chain</a>). I just realized that they no longer have a telephone at the lake, since they have a cell phone. And I doubt that Starbuck (without the final s) has WiFi. I guess that means that posting to PapaScott will be fairly light while we are there. </p>\n<p>On the other hand, we won\'t be getting any pesky emails from our respective employers.</p>',fields:{title:"Not That Starbuck",date:"15 Jul 2005",url:"https://papascott.de/2005-07-15-not-that-starbuck/"}}},pathContext:{slug:"/2005-07-15-not-that-starbuck/",prev:{fields:{title:"Last Day",date:"15 Jul 2005",slug:"/2005-07-15-last-day/"}},next:{fields:{title:"Wanna Ruin Your Resum√©?",date:"15 Jul 2005",slug:"/2005-07-15-wanna-ruin-your-resum/"}}}}}});
